    double CalculateIntakeCalories(IList<Food> list)
    {
        double intakeCal = 0;

        foreach (Food food in list)
        {
            if (food.MealDate.Date == DateTime.Today.Date)
            {
                intakeCal += (food.Calories * food.NumberOfServings);
            }
        }
        Model.intakeCalories = intakeCal;
        return intakeCal;
    }

